def solve(a, b) -> bool:
    if len(a) == 1:
        a = a[0]
    else:
        a, taila = a
    if len(b) == 1:
        b = b[0]
    else:
        b, tailb = b

    if type(a) == type(b):
        if type(a) == type(0):
            if (a < b):
                return True
            elif (a > b):
                return False
            else:
                return solve(taila, tailb)
        else:
            if solve(a, b):
                return solve(taila, tailb)
            else:
                return False
    else:
        if type(a) == type(0):
            return solve([a], b)
        else:
            return solve(a, [b])


solve([[1], [2, 3, 4]], [[1], 4])
